import axios from 'axios';

//Get all teachers
export const getTeachers = () => async (dispatch) => {
  try {
    const res = await axios.get('/teachers');

    dispatch({
      type: GET_TEACHERS,
      payload: res.data,
    });
  } catch (err) {
    dispatch({
      type: TEACHER_ERROR,
      payload: { msg: err.response, status: err.response },
    });
  }
};
